CKEDITOR.plugins.setLang("a11yhelp","gl",{title:"Instruci\xf3ns de accesibilidade",contents:"Axuda. Para pechar este di\xe1logo prema ESC.",legend:[{name:"Xeral",items:[{name:"Barra de ferramentas do editor",legend:"Prema ${toolbarFocus} para navegar pola barra de ferramentas. Para moverse polos distintos grupos de ferramentas use as teclas TAB e MAI\xdaS+TAB. Para moverse polas distintas ferramentas use FRECHA DEREITA ou FRECHA ESQUERDA. Prema ESPAZO ou INTRO para activar o bot\xf3n da barra de ferramentas."},{name:"Editor de di\xe1logo",legend:"Dentro do di\xe1logo, prema TAB para navegar cara os seguintes elementos de di\xe1logo, prema MAI\xdaS+TAB para moverse cara os anteriores elementos de di\xe1logo, prema INTRO para enviar o di\xe1logo, prema ESC para cancelar o di\xe1logo. Cando o di\xe1logo ten m\xfaltiples lapelas, a lista de lapelas pode cinguirse con ALT+F10 ou con TAB como parte da orde de lapelas do di\xe1logo. Coa lapela en foco, pode moverse cara a seguinte ou a anterior lapela coas FRECHAS ESQUERDA e DEREICHA respectivamente."},{name:"Editor do men\xfa contextual",legend:"Prema ${contextMenu} ou a TECLA MEN\xda para abrir o men\xfa contextual. A seguir m\xf3vase \xe1 seguinte opci\xf3n do men\xfa con TAB ou FRECHA ABAIXO. M\xf3vase \xe1 opci\xf3n anterior con MAI\xdaS + TAB ou FRECHA ARRIBA. Prema ESPAZO ou INTRO para seleccionar a opci\xf3n do men\xfa. Abra o submen\xfa da opci\xf3n actual con ESPAZO ou INTRO ou FRECHA DEREITA. Regrese ao elemento principal do men\xfa con ESC ou FRECHA ESQUERDA. Peche o men\xfa contextual con ESC."},{name:"Lista do editor",legend:"Dentro dunha lista, m\xf3vase ao seguinte elemento da lista con TAB ou FRECHA ABAIXO. M\xf3vase ao elemento anterior da lista con MAI\xdaS+TAB ou FRECHA ARRIBA. Prema ESPAZO ou INTRO para escoller a opci\xf3n da lista. Prema ESC para pechar a lista."},{name:"Barra da ruta ao elemento no editor",legend:"Prema ${elementsPathFocus} para navegar ata os elementos da barra de ruta. M\xf3vase ao seguinte elemento bot\xf3n con TAB ou FRECHA DEREITA. M\xf3vase ao bot\xf3n anterior con MAI\xdaS+TAB ou FRECHA ESQUERDA. Prema ESPAZO ou INTRO para seleccionar o elemento no editor."}]},{name:"Ordes",items:[{name:"Orde \xabdesfacer\xbb",legend:"Prema ${undo}"},{name:"Orde \xabrefacer\xbb",legend:"Prema ${redo}"},{name:"Orde \xabnegra\xbb",legend:"Prema ${bold}"},{name:"Orde \xabcursiva\xbb",legend:"Prema ${italic}"},{name:"Orde \xabsubli\xf1ar\xbb",legend:"Prema ${underline}"},{name:"Orde \xabligaz\xf3n\xbb",legend:"Prema ${link}"},{name:"Orde \xabcontraer a barra de ferramentas\xbb",legend:"Prema ${toolbarCollapse}"},{name:"Orde \xabacceder ao anterior espazo en foco\xbb",legend:"Prema ${accessPreviousSpace} para acceder ao espazo m\xe1is pr\xf3ximo de foco inalcanz\xe1bel anterior ao cursor, por exemplo: dous elementos HR adxacentes. Repita a combinaci\xf3n de teclas para chegar a espazos de foco distantes."},{name:"Orde \xabacceder ao seguinte espazo en foco\xbb",legend:"Prema ${accessNextSpace} para acceder ao espazo m\xe1is pr\xf3ximo de foco inalcanz\xe1bel posterior ao cursor, por exemplo: dous elementos HR adxacentes. Repita a combinaci\xf3n de teclas para chegar a espazos de foco distantes."},{name:"Axuda da accesibilidade",legend:"Prema ${a11yHelp}"},{name:"Pegar como texto simple",legend:"Prema ${pastetext}",legendEdge:"Prema ${pastetext}, seguido de ${paste}"}]}],tab:"Tabulador",pause:"Pausa",capslock:"Bloq. Mai\xfas",escape:"Escape",pageUp:"P\xe1xina arriba",pageDown:"P\xe1xina abaixo",leftArrow:"Frecha esquerda",upArrow:"Frecha arriba",rightArrow:"Frecha dereita",downArrow:"Frecha abaixo",insert:"Inserir",leftWindowKey:"Tecla Windows esquerda",rightWindowKey:"Tecla Windows dereita",selectKey:"Escolla a tecla",numpad0:"Tec. num\xe9rico 0",numpad1:"Tec. num\xe9rico 1",numpad2:"Tec. num\xe9rico 2",numpad3:"Tec. num\xe9rico 3",numpad4:"Tec. num\xe9rico 4",numpad5:"Tec. num\xe9rico 5",numpad6:"Tec. num\xe9rico 6",numpad7:"Tec. num\xe9rico 7",numpad8:"Tec. num\xe9rico 8",numpad9:"Tec. num\xe9rico 9",multiply:"Multiplicar",add:"Sumar",subtract:"Restar",decimalPoint:"Punto decimal",divide:"Dividir",f1:"F1",f2:"F2",f3:"F3",f4:"F4",f5:"F5",f6:"F6",f7:"F7",f8:"F8",f9:"F9",f10:"F10",f11:"F11",f12:"F12",numLock:"Bloq. num.",scrollLock:"Bloq. despraz.",semiColon:"Punto e coma",equalSign:"Signo igual",comma:"Coma",dash:"Gui\xf3n",period:"Punto",forwardSlash:"Barra inclinada",graveAccent:"Acento grave",openBracket:"Abrir corchete",backSlash:"Barra invertida",closeBracket:"Pechar corchete",singleQuote:"Comi\xf1a simple"});